import React from 'react';

const Dashboard = ({photos}) => {
  let noImageDiv = <div className="no-photos"> no images yes, please upload some! </div>;
  return (
    <div className="dashboard-wrapper">
      {photos.length ? photos.map((image, idx) => <img className={`photo ${image.class}`} src={image.url} key={idx} />) : noImageDiv }
    </div>
  )
}

export default Dashboard;
